export function LandingPage() {
    return(
        <div>
            <Title />
            <AddressInput />
            <GoogleAPI />
        </div>
    );
}

function Title() {
    return(
        <h1>FundsToVotes</h1>
    )
}

function AddressInput() {
    return(
        <form>
            <label>
                Address:
                <input type="text" address="address"/>
            </label>
            <input type="submit" value="submit"/>
        </form>
    )
}
